 Here is a simple Python function that checks if a number is prime:

```python
def is_prime(n):
    if n <= 1:
        return False
    elif n <= 3:
        return True
    else:
        for i in range(2, int(math.sqrt(n)) + 1):
            if n % i == 0:
                return False
        return True
```
You can use this function like this:
```python
import math
print(is_prime(5)) # True
print(is_prime(6)) # False
```
This function works by checking if the number is less than or equal to 1, in which case it's not prime. If it's greater than 1 and less than or equal to 3, then it is prime. For larger numbers, it checks all numbers from 2 up to the square root of the number to see if any of them divide the number evenly. If none do, then the number is prime.
